import React from 'react';
import { Pie } from 'react-chartjs-2';

const data = {
  labels: ['65%', '35%'], // Labels for the segments
  datasets: [
    {
      data: [65, 35], // Data values, 65% and 35%
      backgroundColor: ['#FF5733', '#E0E0E0'], // Colors for the segments
    },
  ],
};

const options = {
  maintainAspectRatio: false,
};
